import { Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';
import {siteNo} from '../api/keywordJob'
import { useEffect } from 'react';

export default function KeywordCheckTable(){
    useEffect(() => {
        const fetchData = async () => {
          try {
            const response = await axios.get('https://jsonplaceholder.typicode.com/users');
            const users = response.data;
            // console.log(users);
            const data: createData = users.map((item: any) => ({
              name: item.name,
              username: item.name,
              address: item.address.city,
              email: item.email,
              company: item.company.name,
              id: item.id,
            }));
            console.log(data);
            // setTableData(data);
          } catch (error) {
            console.error('Error fetching users:', error);
          }
        };
        fetchData();
      }, []);

    function createData(
        name: string,
        calories: number,
        fat: number,
        carbs: number,
        protein: number,
      ) {
        return { name, calories, fat, carbs, protein };
      }

      const rows = [
        createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
        createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
        createData('Eclair', 262, 16.0, 24, 6.0),
        createData('Cupcake', 305, 3.7, 67, 4.3),
        createData('Gingerbread', 356, 16.0, 49, 3.9),
      ];

    return(
        <div style={{ height: 600, width: '95%',marginLeft:'40px'}}>
            <TableContainer component={Paper}>
            <Table sx={{ minWidth: 650 }} aria-label="simple table">
                <TableHead>
                <TableRow>
                    <TableCell>신청일</TableCell>
                    <TableCell align="right">광고상품</TableCell>
                    <TableCell align="right">작업구분</TableCell>
                    <TableCell align="right">작업명</TableCell>
                    <TableCell align="right">작업상태</TableCell>
                    <TableCell align="right">수행시작</TableCell>
                    <TableCell align="right">수행종료</TableCell>
                    <TableCell align="right">등록파일</TableCell>
                    <TableCell align="right">결과</TableCell>
                    <TableCell align="right">대기취소</TableCell>
                    <TableCell align="right">요청자</TableCell>
                </TableRow>
                </TableHead>
                <TableBody>
                {rows.map((row) => (
                    <TableRow
                    key={row.name}
                    sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                    >
                    <TableCell component="th" scope="row">
                        {row.name}
                    </TableCell>
                    <TableCell align="right">{row.calories}</TableCell>
                    <TableCell align="right">{row.fat}</TableCell>
                    <TableCell align="right">{row.carbs}</TableCell>
                    <TableCell align="right">{row.protein}</TableCell>
                    </TableRow>
                ))}
                </TableBody>
            </Table>
            </TableContainer>
      </div>
    );
}
